import React from 'react';
import girl from './images/hero-desktop.jpg';
import logo from './images/logo.svg';
import Email from './Email';

function App() {
  return (
    <div class='mainContainer'>
      <header><img src={logo} alt='logo'></img> </header>
      <img class='girl' src={girl} alt='girl'></img>
      <section>
        <h1>WE'RE</h1>
        <h1>COMING</h1>
        <h1>SOON</h1>
        <p>Hello fellow shoppers! We're currently building our new fashion store. Add your email below to stay up-to-date with announcments and our launch deals.</p>
      <Email/>
      </section>
    </div>
  );
}

export default App;
